import React, { Component } from 'react';
import Prompt from '../Posts/Prompt'

class Feed extends Component {
    state = {  }

    getPrompts(){
        var posts = this.props.posts
        if(posts){
            posts.map(function(item, i){
                return <Prompt id={item.id}/>
            })
        }
    }

    render() {
        return (
            <div>
                {this.getPrompts()}
            </div>
        );
    }
}

export default Feed;
